import React, { useState } from 'react'
import "./SignIn.css"
import Navigator from '../Navs/Navigate'
import emoji from 'react-easy-emoji';

export default function SignIn() {
  const [formData, setFormData] = useState({
    email: '',
    password: '',
  });

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();
    // Add login logic here (e.g., API call)
    console.log(formData);
  };

  // Handle input changes
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };
  return (
    <div id='sign-bg-div'>
      <Navigator /><h3 id='welcome-text'>WELCOME BACK{emoji('üçÄ')}</h3>
      <div id='fset' className='container bg-light'>
        <div className="container mt-5">

          <div className="row justify-content-center">
            <div className="col-md-6">
              <h2 id='Login-text' className="h3">LOGIN</h2>
              <form onSubmit={handleSubmit}>
                <div className="form-group">
                  <input
                    type="email"
                    placeholder='Email'
                    className="form-control"
                    name="email"
                    value={formData.email}
                    onChange={handleChange}
                    required
                  />
                  <small><i><a id='log-a' href="###">forgot Email??</a></i></small>
                </div> <br/>

                <div className="form-group">
                  <input
                    type="password"
                    placeholder='Password'
                    className="form-control"
                    name="password"
                    value={formData.password}
                    onChange={handleChange}
                    required
                  />
                  <small><i><a id='log-a' href="###">forgot password??</a></i></small>

                </div>
                <button id='login-btn' type="submit" className="btn btn-success">Login</button><br/>
                <small><i>You dont have an Account? <a id='log-a' href="/register">Sign Up</a> </i></small>
              </form>
            </div>
          </div>
        </div>
      </div>

    </div>
  )
}
